import React from "react";
import { Link } from "react-dom";

function Navbar() {
  return (
    <nav className="navbar">
      <Link className="navbar__brand" to="/">
        Google Books Search
      </Link>
      <div className="navbar__nav">
        <Link to="/saved" className="navbar__nav--item">
          Saved
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
